import React from 'react';
import Marquee from 'react-marquee-master';

function Lists() {

    const marqueeItems = ['One', 'Two', 'Three'];
    return (<Marquee style={{ zIndex: '1030' }}  direction='up' marqueeItems={marqueeItems} />);
}

export default Lists;
